# ====================================================================
# ROTAS DA API
# ====================================================================

@app.route('/')
def home():
    return jsonify({"message": "Bem-vindo à sua API de dados no Vercel!",
                    "endpoints": {
                        "/api/games": "Lista jogos",
                        "/api/movies": "Lista filmes",
                        "/api/random_image": "Imagem aleatória",
                        "/api/jokes": "Piada aleatória",
                        "/api/books": "Lista livros",
                        "/api/products": "Lista produtos"
                    }})

@app.route('/api/games')
def get_games():
    return jsonify(GAMES_DATA)

@app.route('/api/movies')
def get_movies():
    return jsonify(MOVIES_DATA)

@app.route('/api/random_image')
def get_random_image():
    if not RANDOM_IMAGES_DATA:
        return jsonify({"message": "Nenhuma imagem aleatória disponível."}), 404
    return jsonify(random.choice(RANDOM_IMAGES_DATA))

@app.route('/api/jokes')
def get_random_joke():
    if not JOKES_DATA:
        return jsonify({"message": "Nenhuma piada disponível."}), 404
    return jsonify({"joke": random.choice(JOKES_DATA)})

@app.route('/api/books')
def get_books():
    return jsonify(BOOKS_DATA)

@app.route('/api/products')
def get_products():
    return jsonify(PRODUCTS_DATA)

# Você pode adicionar um tratamento de erro básico
@app.errorhandler(404)
def not_found(error):
    return jsonify({"error": "Não encontrado", "message": "O recurso solicitado não foi encontrado."}), 404

